using ShineEngine;

/// <summary>
/// 状态类型表(generated by shine)
/// </summary>
public class StatusType
{
	/// <summary>
	/// 死亡
	/// </summary>
	public const int IsDead=1;
	
	/// <summary>
	/// 处于战斗状态
	/// </summary>
	public const int OnFight=2;
	
	/// <summary>
	/// 不可被选择(蝗虫群)
	/// </summary>
	public const int CantBeTarget=3;
	
	/// <summary>
	/// 不可移动
	/// </summary>
	public const int CantMove=4;
	
	/// <summary>
	/// 不可转身
	/// </summary>
	public const int CantTurn=5;
	
	/// <summary>
	/// 不可攻击
	/// </summary>
	public const int CantAttack=6;
	
	/// <summary>
	/// 不可施法
	/// </summary>
	public const int CantCast=7;
	
	/// <summary>
	/// 眩晕(等价于以上4个)
	/// </summary>
	public const int Vertigo=8;
	
	/// <summary>
	/// 控制免疫
	/// </summary>
	public const int ControlImmun=9;
	
	/// <summary>
	/// 伤害免疫
	/// </summary>
	public const int DamageImmun=10;
	
	/// <summary>
	/// 敌对不可选(无敌)
	/// </summary>
	public const int CantBeEnemyTarget=11;
	
	/// <summary>
	/// 完整无敌(等价于以上3个加不可被伤害击杀)
	/// </summary>
	public const int Invincible=12;
	
	/// <summary>
	/// 绝对命中(克制绝对闪避)
	/// </summary>
	public const int AbsHit=13;
	
	/// <summary>
	/// 绝对闪避
	/// </summary>
	public const int AbsDodge=14;
	
	/// <summary>
	/// 绝对暴击
	/// </summary>
	public const int AbsCrit=15;
	
	/// <summary>
	/// 绝对韧性(克制绝对暴击)
	/// </summary>
	public const int AbsTenacity=16;
	
	/// <summary>
	/// 隐身
	/// </summary>
	public const int Hide=17;
	
	/// <summary>
	/// 安全区(mmo)
	/// </summary>
	public const int SafeRegion=18;
	
	/// <summary>
	/// 吸收子弹(盾墙)
	/// </summary>
	public const int AbsorbBullet=19;
	
	/// <summary>
	/// 不可被攻击(attack跳过)
	/// </summary>
	public const int CantBeAttackTarget=20;
	
	/// <summary>
	/// 不可被伤害击杀(暗牧-薄葬,蛮王大)
	/// </summary>
	public const int CantBeKillByDamage=21;
	
	/// <summary>
	/// 不可被治疗
	/// </summary>
	public const int CantBeHeal=22;
	
	/// <summary>
	/// 技能免疫(弱于敌对不可选)
	/// </summary>
	public const int SkillImmun=23;
	
	/// <summary>
	/// 长度
	/// </summary>
	public static int size=24;
	
}
